import React, { useState, useEffect } from "react";
import Navbar from './components/Navbar/Navbar';
import AOS from "aos";
import $ from 'jquery';
function App() {
  useEffect(() => {
    AOS.init();
    AOS.refresh();
  }, []);
  const [isOpen, setIsOpen] = useState(false);
  return (
    <div className="container">
    <Navbar setIsOpen={setIsOpen} isOpen={isOpen}/>

  </div>
  );
}

export default App;
